import React from 'react';
import { Navigate } from "react-router-dom"
import Login from "./User"

function Dashboard() {

    if (<Login signed={false} />) {
        return (
            <Navigate to="/login"/>
        )
    } else 
    return(
        <div>Hello Dashboard</div>
    )
}

export default Dashboard;
